import React from 'react';
import TextField from '@material-ui/core/TextField';

function Login(){

    return(
        <div width="10px">
            <div style={{margin: "0 auto"}}>
                <TextField
                    id="standard-full-width"
                    label="Label"
                    style={{ margin: 8 }}
                    placeholder="Placeholder"
                    margin="normal"
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
            </div>
        </div>
    )

}

export default Login;
